INSERT INTO `up_portlet_pref_values` VALUES ('50', '_\n            \n                <script language=\"Javascript\" type=\"text/javascript\">\n                  up.jQuery(function() {\n                    var $ = up.jQuery;\n                \n                    $(document).ready(function(){\n                      // set up jQuery UI effects demo\n                      $(\".effects-demo-outerbox\").click(function(){ $(\".effects-demo-innerbox\").effect(\"bounce\"); });\n                      $(\".effects a\").click(function(){ \n                        var effect = $(this).text();\n                        $(\".effects-demo-innerbox h3\").text(effect);\n                        $(\".effects-demo-outerbox\").unbind();\n                        if ($(this).parent().parent().hasClass(\"showhide-effects\")) {\n                          $(\".effects-demo-outerbox\").click(function(){ $(\".effects-demo-innerbox\").toggle(effect.toLowerCase()); });\n                        } else if (effect == \'Scale\') {\n                          $(\".effects-demo-outerbox\").toggle(\n                            function() { $(\".effects-demo-innerbox\").effect(\"scale\", { percent: 50 }); }, \n                            function() { $(\".effects-demo-innerbox\").effect(\"scale\", { percent: 200 });\n                          });\n                        } else {\n                          $(\".effects-demo-outerbox\").click(function(){ $(\".effects-demo-innerbox\").effect(effect.toLowerCase()); });\n                        }\n                      });\n                      \n                      // set up jQuery UI widget demos\n                      $(\".accordion-demo\").accordion({ clearStyle:true, collapsible:true, active:false });\n                      $(\".datepicker-demo\").datepicker();\n                      $(\".tabs-demo\").tabs();\n                      \n                      // set up fluid component demos\n                      up.fluid.reorderList(\".list-reorderer ol\", { selectors: { movables: \"> li\"} });\n                      up.fluid.pager(\".pager-demo\", {\n                        listeners: {\n                            onModelChange: function(link) {\n                                $(\".fluid-pager-demo-items li\").css(\"display\", \"none\");\n                                $(\".fluid-pager-demo-items li:not(:lt(\" + link.pageIndex*5 +\")):lt(5)\").css(\"display\", \"block\");\n                                return false;\n                            }\n                        }\n                      });\n                      \n                      \n                      // set up demo switching functionality\n                      $(\".demo-list li\").click(function(){\n                        $(\".demo-list\").css(\"display\", \"none\");\n                        $(\".\" + $(this).text().toLowerCase().replace(\" \", \"-\")).css(\"display\", \"block\");\n                        $(\".demo-back-link\").css(\"display\", \"block\");\n                        if ($(this).text() == \'Accordion\') {\n                            console.log(\'accordion\');\n                            $(\".accordion-demo\").accordion(\'activate\', 0);\n                        }\n                        return false;\n                      });\n                      $(\".demo-back-link\").click(function(){\n                        $(\".demo-back-link\").css(\"display\", \"none\");\n                        $(\".demo-container\").css(\"display\", \"none\");\n                        $(\".demo-list\").css(\"display\", \"block\");\n                      });\n                    \n                    });\n                  });\n                </script>\n            \n                <style type=\"text/css\">\n                  .demo-container {display:none; max-width:600px}\n                  .demo-back-link {display:none}\n                  .effects ul, .effects li {list-style-type:none; margin: 0}\n                  .list-reorderer ol li {padding:5px; margin:5px;}\n                  .list-reorderer ul li {margin:0px; padding:0px;}\n                  .list-reorderer .orderable-default{background-color:#eee;}\n                  .list-reorderer .orderable-hover{background-color:lightyellow; cursor:move;}\n                  .list-reorderer .orderable-selected{background-color: #ddd;}\n                  .list-reorderer .orderable-dragging {background-color: lightyellow;}\n                  .list-reorderer ol .orderable-drop-marker {background-color: red; height:4px !important; padding:0 0 0 0; border-width: 0px !important; list-style-type:none; font-size:0px; line-height:0px; overflow:hidden;}\n                </style>\n                \n                <div class=\"demo-list\">\n                  <h2>jQuery UI Demos</h2>\n                  <ul>\n                    <li><a href=\"javascript:;\">Datepicker</a></li>\n                    <li><a href=\"javascript:;\">Accordion</a></li>\n                    <li><a href=\"javascript:;\">Tabs</a></li>\n                    <li><a href=\"javascript:;\">Effects</a></li>\n                  </ul>\n                  \n                  <p>\n                    This uPortal release contains the jQuery UI 1.7.2 final release.  \n                    For more jQuery UI demos and sample source code, please visit \n                    <a href=\"http://jqueryui.com/demos/\" target=\"_blank\">http://jqueryui.com/demos</a>.\n                  </p>\n                  \n                  <h2>Fluid Component Demos</h2>\n                  <ul>\n                    <li><a href=\"javascript:;\">Pager</a></li>\n                    <li><a href=\"javascript:;\">List Reorderer</a></li>\n                  </ul>\n                  \n                  <p>\n                    This uPortal release contains the Fluid 1.1.2 final release.  For more \n                    Fluid demos and sample source code, please visit \n                    <a href=\"http://build.fluidproject.org/infusion/demo