/a></li> -->\n                            <!-- <li><a href=\"javascript:;\">Transfer</a></li> -->\n                          </ul>\n                        </div>\n                        <div class=\"fl-col-flex50\">\n                          <h4>Show/Hide</h4>\n                          <ul class=\"showhide-effects\">\n                            <li><a href=\"javascript:;\">Blind</a></li>\n                            <li><a href=\"javascript:;\">Clip</a></li>\n                            <li><a href=\"javascript:;\">Drop</a></li>\n                            <li><a href=\"javascript:;\">Explode</a></li>\n                            <li><a href=\"javascript:;\">Fold</a></li>\n                            <li><a href=\"javascript:;\">Puff</a></li>\n                            <li><a href=\"javascript:;\">Scale</a></li>\n                            <li><a href=\"javascript:;\">Slide</a></li>\n                          </ul>\n                        </div>\n                      </div>\n                    </div>\n                  </div>\n                </div>\n            \n                  <div class=\"demo-container list-reorderer\">\n                    <h2>Fluid Reorderer: Sortable List</h2>\n                    <h3>Conference Planning To-do List</h3>\n                    <ol>\n                      <li>Select the date</li>\n                      <li>Create promotional plan\n                        <ul>\n                          <li>email campaign</li>\n                          <li>web site</li>\n                          <li>print materials</li>\n                        </ul>\n                      </li>\n                      <li id=\"myUniquePrefix.orderable3\">Book facilities\n                        <ul>\n                          <li>Select building</li>\n                          <li>Book rooms</li>\n                        </ul>\n                      </li>\n                      <li>Book caterer</li>\n                      <li id=\"myUniquePrefix.orderable5\">Book block of hotel rooms</li>\n                      <li id=\"myUniquePrefix.orderable6\">\n                        Develop a conference daily schedule of events\n                      </li>\n                      <li>Book speakers\n                        <ul>\n                          <li>Keynote</li>\n                          <li>Internal/employee</li>\n                        </ul>\n                      </li>\n                      <li>Plan the registration process\n                        <ul>\n                          <li>Deadline for early bird and final registrations</li>\n                          <li>Create/enter data into database</li>\n                          <li>Create/upload information for web registration</li>\n                        </ul>\n                      </li>\n                      <li id=\"myUniquePrefix.orderable9\">\n                        Book audio visual equipment and technicians\n                      </li>\n                      <li>Create name tags and welcome packages\n                        <ul>\n                          <li>schedule of events</li>\n                          <li>maps, tickets</li>\n                          <li>paper, pen, trinkets</li>\n                          <li>instructions</li>\n                        </ul>\n                      </li>\n                    </ol>\n                </div>\n                \n                <div class=\"demo-container pager\">\n                    <h2>Fluid Pager</h2>\n                    \n                    <div class=\"pager-demo fl-pager\">\n                      <div id=\"pager-top\" class=\"flc-pager-top\">\n                        <ul class=\"fl-pager-ui\">\n                             <li><a class=\"flc-pager-previous\" href=\"javascript:;\">&lt; prev</a></li>\n                             <li>\n                                <ul class=\"fl-pager-links flc-pager-links\" style=\"margin:0; display:inline\">\n                                     <li value=\"1\" class=\"flc-pager-pageLink\"><a href=\"javascript:;\">1</a></li>\n                                     <li value=\"2\" class=\"flc-pager-pageLink\"><a href=\"javascript:;\">2</a></li>\n                                     <li value=\"3\" class=\"flc-pager-pageLink\"><a href=\"javascript:;\">3</a></li>\n                                </ul>\n                             </li>\n                             <li><a class=\"flc-pager-next\" href=\"javascript:;\">next &gt;</a></li>\n                            <!-- <li>\n                              <span class=\"flc-pager-summary\">1 of 2</span>\n                              <span> <select class=\"pager-page-size flc-pager-page-size\">\n                                  <option value=\"5\">5</option>\n                                  <option value=\"10\">10</option>\n                              </select></span>\n                            </li>  -->\n                        </ul>\n                      </div>\n                    </div>\n                    <div>\n                        <ul class=\"fluid-pager-demo-items\">\n                            <li>Item 1</li><li>Item 2</li><li>Item 3</li><li>Item 4</li><li>Item 5</li>\n                            <li>Item 6</li><li>Item 7</li><li>Item 8</li><li>Item 9</li><li>Item 10</li>\n                            <li>Item 11</li><li>Item 12</li><li>Item 13</li><li>Item 14</li><li>Item 15</li>\n                        </ul>\n                    </div>\n                </div>\n                \n                <div class=\"demo-back-link\" style=\"clear:both; padding:10px;\">\n                  <p><a href=\"javascript:;\">&lt; Back to available demos list</a></p>\n                </div>\n            \n        ', '0');
INSERT INTO `up_portlet_pref_values` VALUES ('51', '_\n            \n                <h2>How and why to log in</h2>\n                \n                <p>As you can see, uPortal can aggregate and present content generically for \n                unauthenticated users. When users log in, uPortal can do much more, with personalized \n                content, customized layouts, group membership, and access control. These are the \n                example username, password pairs for the example users included with uPortal:</p>\n                \n                <table>\n                    <tr>\n                        <th>Username</th><th>Password</th><th>Comments</th>\n                    </tr>\n                    <tr>\n                        <td>student</td><td>student</td><td>Mocked up student content</td>\n                    </tr>\n                    <tr>\n                        <td>admin</td><td>admin</td>\n                        <td>Be sure to change this password! The admin user can administer many \n                        aspects of the portal, including publishing new content and editing access control.</td>\n                    </tr>\n                    <tr>\n                        <td>developer</td><td>developer</td>\n                        <td>Be sure to change this password! The developer user can administer many \n                        aspects of the portal, including publishing new content and editing access control.</td>\n                    </tr>\n                    <tr>\n                        <td>faculty</td><td>faculty</td><td>Mocked up faculty content</td>\n                    </tr>\n                    <tr>\n                        <td>staff</td><td>staff</td><td>Mocked up staff content</td>\n                    </tr>\n                </table>\n            \n        ', '0');
